import * as React from "react";
import Card from "@mui/material/Card";
import CardActions from "@mui/material/CardActions";
import CardContent from "@mui/material/CardContent";
import CardMedia from "@mui/material/CardMedia";
import Button from "@mui/material/Button";
import Typography from "@mui/material/Typography";
import Grid from "@mui/material/Grid";
import picNahom from "../Export/edited2.jpg";
import { Divider } from "@mui/material";

export default function About() {
  return (
    <Grid container spacing={3}>
      <Grid item xs>
        <Card sx={{ maxWidth: "28.5rem", float: "right" }}>
          {/* <Typography gutterBottom variant="h5" component="div">
        Lizard
      </Typography> */}
          <CardMedia
            component="img"
            alt="green iguana"
            sx={{}}
            // height="540"
            src={picNahom}
          />
          {/* <CardContent>

      </CardContent> */}
        </Card>
      </Grid>
      <Grid item xs={8}>
        <Typography variant="body2" color="text.secondary">
          <Typography gutterBottom variant="h5" component="div">
            About
          </Typography>
          Junior web developer adept in all stages of advanced web development.
          Knowledgeable in user interface, testing, and debugging processes.
          Bringing forth expertise in design, installation, testing and
          maintenance of web systems. Equipped with a diverse and promising
          skill-set. Proficient in an assortment of technologies, including
          HTML, CSS, JavaScript, React,Redux,TypeScript,Node.js, PHP, Symfony,
          Continuous Integration(AWS), Unit Testing, Content Management(Drupal),
          MariaDB, and MicrosoftSQLServer.AlsoFigma,TrelloandDockerareintheset.
          Abletoeffectively self-manage during independent projects, as well as
          collaborate in a team setting.
        </Typography>
        <Divider />
        <Typography>
          - Involved in finding solutions for problems that have been hidden. -
          Worked as a productive and positive team member to design, code, test,
          report, and debug operations. - Managed front and back-end in my
          personal project. - Successfully identif ied, diagnosed, and f ixed
          website problems, including broken links, typographical errors, and
          formatting issues. - Evaluated and became knowledgeable in new
          standards, technologies, and trends in website development.
        </Typography>
      </Grid>
    </Grid>
  );
}
